import React from 'react';
import {RuleSection} from './exportfiles';

function NotesSection() {
  
  return (
    <>
    <div className="col-md-3">
   <div className="scrollContainer" style={{maxHeight: "310px",
    overflowY: "scroll",
    marginTop: "10px",
    padding: "0px",
    marginRight: "-95px"}}>

      <div className="title" style={{margin:"0px",padding:"0px",display:"flex",alignContent:"space-between"}}>
        <p style={{fontWeight:"500"}}>Notes</p>
        <button type="button" className="btn btn-primary" data-bs-toggle="modal" data-bs-target="#exampleModal">
        <i className="fas fa-plus"></i>
      </button>
      </div>
   </div>
    <RuleSection/>
      </div>
    </>
    );
}

export default NotesSection;
